.text
	
	main: 
		
		jal 	draw_menu			# draw the menu

		li 	$t0, 	0xffff0000   # Receiver Control register address
		li 	$t1, 	0xffff0004   # Receiver Data register address
		loop:
		lw $t2, 0($t0)      # Read Receiver Control register
		andi $t2, $t2, 1    # Mask out Ready bit
		beqz $t2, loop

		lw $t3, 0($t1)
		beq	$t3,	20,	draw_character
		
		jal	draw_character

		jr		$ra

	####################################################
	####################################################
	############			 *				############
	############	*	 PROCEDURES 	*	############
	############			 *				############
	####################################################
	####################################################

	# Drawing the start menu
	

	draw_menu:

		li		$t0, 	BASE_ADDRESS
		la		$t1, 	menu
		li 		$t3, 	1

	draw_menu_loop:

		lw	 	$t2, 	0($t1)
		
		sw	 	$t2, 	0($t0)
		addi 	$t0, 	$t0, 	4
		addi 	$t1, 	$t1, 	4

		addi 	$t3, 	$t3, 	1
		bne		$t3, 	16384,	draw_menu_loop
		
		jr 		$ra

	# Drawing the win screen

	draw_win_screen:

		li		$t0,	BASE_ADDRESS
		la		$t1,	win_screen
		li		$t3,	1

	draw_win_screen_loop:

		lw		$t2,	($t1)

		sw		$t2,	0($t0)
		addi	$t0,	$t0,	4
		addi 	$t1,	$t1,	4

		addi	$t3,	$t3,	1
		bne		$t3,	16384,	draw_win_screen_loop

		jr		$ra

	# Drawing the loss screen

	draw_loss_screen:

		li		$t0,	BASE_ADDRESS
		la		$t1,	win_screen
		li		$t3,	1

	draw_loss_screen_loop:

		lw		$t2,	0($t1)

		sw		$t2,	0($t0)
		addi	$t0,	$t0,	4
		addi	$t1,	$t1,	4

		addi	$t3,	$t3,	1
		bne		$t3,	16384,	draw_loss_screen_loop

		jr 		$ra

	draw_character:

		la		$t0,	character_starting_position
		la		$t1,	char_2
		li		$t3,	1
		li		$t8,	0
		li		$t9,	0
		
	draw_character_inner_loop:

		lw		$t2,	0($t1)

		sw		$t2,	0($t0)
		addi	$t0,	$t0,	4
		addi	$t1,	$t1,	4

		addi	$t3,	$t3,	1
		addi	$t8,	$t8,	1
		
		bne		$t8,	32,		draw_character_inner_loop

	draw_character_outer_loop:

		addi	$t9,	$t9,	1
		li		$t8,	0
		addi	$t0,	$t0,	128
		bne		$t9,	32,		draw_character_inner_loop

		jr		$ra

	END:
